`,_.jsxs(e.p,{children:["In den vorherigen Kapiteln, haben wir gelernt dass der Computer alle Daten in ",_.jsx(e.code,{children:"Bits"})," abspeichert. Sobald wir diese ",_.jsx(e.code,{children:"Bits"})," zusammen gruppieren und zu einem ",_.jsx(e.code,{children:"Byte"})," fassen, können wir bereits sehr viele Informationen damit repräsentieren. Das haben wir beim ",_.jsx(e.code,{children:"ASCII"}),"-Code gesehen, aber auch bei den Bildern, bei denen wir jeweils ein Pixel mit 3 Farbkanälen dargestellt haben. Wir haben also die Daten die im Computer gespeichert sind, auf eine ganz bestimmte Art und Weise ",_.jsx(e.strong,{children:"interpretiert"}),". Diese ",_.jsx(e.strong,{children:"Interpretation"})," können wir auf dem Computer als ",_.jsx(e.strong,{children:"Sprache"})," bezeichnen."]}),`
`,_.jsxs(e.p,{children:["Diese ",_.jsx(e.strong,{children:"Sprachen"})," können unterschiedlich kompliziert oder auch sehr einfach sein. Wichtig dabei ist, dass diese ",_.jsx(e.strong,{children:"Sprachen"})," immer irgendwo festgelegt sind. Der Computer verwendet diese ",_.jsx(e.strong,{children:"Sprachen"})," dann um einen Speicherblock zu ",_.jsx(e.strong,{children:"interpretieren"})," und damit etwas vernünftiges anzufangen. Ganz wichtig dabei ist, der Computer kann nicht wissen was wir meinen, und unpräzise Aussagen von uns korrigieren. Der Computer kann nur ganz genau einer ",_.jsx(e.strong,{children:"Sprache"})," folgen, wie zum Beispiel dem ",_.jsx(e.code,{children:"ASCII"}),"-Code."]}),`
`,_.jsxs(qo,{title:"ASCII vs Bild",children:[_.jsxs(e.p,{children:["Der Computer kann jeden Speicherblock mit jeder beliebigen Sprache interpretieren. Manchmal geht es sogar auf, das der gleiche Speicherblock mit verschiedenen Sprachen Sinn ergibt. Meist ist dies aber nicht der Fall. Wir schauen und als Beispiel einen Speicherblock im ",_.jsx(e.code,{children:"ASCII"}),"-Code an. Dann interpretieren wir den gleichen Speicherblock als Bild."]}),_.jsx(Y6e,{}),_.jsxs(e.p,{children:["An dem Beispiel können Sie ganz gut erkennen, das der Computer einfach nur versucht einen Speicherblock mit der angegebenen Sprache zu ",_.jsx(e.strong,{children:"interpretieren"}),". Manchmal geht das recht gut auf, aber schon in dem Beispiel hier, funktioniert es oftmals nicht, da wir nicht immer genügend Zeichen haben, um alle Pixel zu füllen."]})]}),`
`,_.jsx(e.h2,{children:"Verschiedene Sprachen"}),`
`,_.jsxs(e.p,{children:["Es gibt unzählige ",_.jsx(e.strong,{children:"Sprachen"})," die wir auf dem Computer verwenden können. Wir können auch unsere ganz eigene Sprache erfinden, wenn wir das möchten. Eine eigene Sprache macht allerdings nicht so viel Sinn, denn andere Personen oder Programme werden diese nicht verstehen, ausser diese Sprache wird in das neue Programm implementiert. Das wäre aber ein sehr grosser Aufwand, deshalb hat man sich auf einige Standarts geeinigt, die dann als Sprachen überall verwendet werden. Ein besserer Begriff für ",_.jsx(e.strong,{children:"Sprachen"})," wäre in unserem Fall: ",_.jsx(e.strong,{children:"Dateiformat"}),". Es wirkt ein wenig merkwürdig wenn wir bei Bildern von ",_.jsx(e.strong,{children:"Sprache"})," reden, das ganze soll aber zeigen wie wichtig die ",_.jsx(e.strong,{children:"Sprachen"})," in der Informatik überhaupt sind. Hier finden Sie eine kurze Liste von ",_.jsx(e.strong,{children:"Sprachen"})," von denen wir uns einige anschauen werden."]}),`
