`,_.jsxs(e.p,{children:["Das bringt uns leider nicht so viel, denn Linien können wir bereits zeichnen. Aber an diesem sehr einfachen Beispiel, können Sie gleich sehen wie ein ",_.jsx(e.code,{children:"path"}),"-Element eigentlich funktioniert. Wir haben die ganz normalen Attribute, die wir auch auf anderen Elementen setzen. Damit überhaupt etwas gezeichnet wird, müssen wir ",_.jsx(e.code,{children:"stroke"})," angeben, und ",_.jsx(e.code,{children:"stroke-width"})," damit wir das Resultate besser sehen können. Dann kommt aber noch ein neues Attribut dazu, das ",_.jsx(e.code,{children:"d"}),"-Attribut. Dieses enthält die Daten für den Pfad, also die Instruktionen, wie dieser gezeichnet werden soll. Auf den ersten Blick sieht der Inhalt davon recht kompliziert aus, aber das können wir ganz schnell vereinfachen, denn es sind nur einfache Zeichenbefehle."]}),`
`,_.jsxs(ts,{classes:"important",children:[_.jsx(e.h2,{children:"Zeichenbefehle für Pfade"}),_.jsxs(e.p,{children:["Die Zeichenbefehle funktionieren alle auf die gleiche Art. Die Art ist auch sehr einfach, Sie müssen aber jeweils wissen, wie viele Parameter ein Befehl braucht. Ganz generell funktionieren diese Befehle immer so: Ein Buchstabe gibt die Art des Befehls an, dann werden so viele Zahlen gelesen wie der Befehl braucht, dann kann ein weiterer Buchstabe kommen um einen neuen Befehl zu starten. Es ist sehr ",_.jsx(e.strong,{children:"wichtig"})," dass Sie zwischen Gross- und Kleinschreibung unterscheiden, wieso wird aber erst später erklärt. Für den Moment schreiben wir alles mit Grossbuchstaben. Damit diese Zeichenbefehle einfacher zu verstehen sind, stellen Sie sich einfach vor, dass Sie mit diesen Befehlen die Spitzen von einem Stift befehligen."]}),_.jsxs(e.ul,{children:[`
