`,_.jsx(e.p,{children:"Mit Pfaden haben wir die Möglichkeit komplexere Formen zu zeichnen, als nur gerade Linien. Diese werden aber schnell sehr kompliziert und sind nicht direkt für Code geeignet. Meistens möchte man dafür ein Zeichenwerkzeug haben. Wir schauen uns aber die einfachste Form von einer sogenannten Bézier-Kurve an."}),`
`,_.jsx(e.p,{children:"Bei Bézier-Kurven, geht es immer darum, dass Sie sogenannte Kontrollpunkte einführen. Der Pfad wird dann zu diesem Kontrollpunkt hin gezogen und es entsteht eine leichte Krümmung in der Kurve. Wir schauen und dazu ein Beispiel an, und zeichnen sämtliche Punkte die bei der Kurve verwendet werden ein. Die grünen Punkte sind Start- und Endpunkt, der rote ist der Kontrollpunkt."}),`
