`,_.jsxs(e.p,{children:["Wir sehen das die Kurve durch den Start- und Endpunkt geht. Während die Kurve aber gezeichnet wird, wird der Stift immer hin zum Kontrollpunkt gezogen. So bekommen wir eine angenehme Krümmung in die Kurve. Verantwortlich dafür ist der Zeichenbefehl ",_.jsx(e.code,{children:"Q"}),"."]}),`
