`,_.jsx(e.h2,{children:"Turtle Graphics mit Pfaden"}),`
`,_.jsxs(e.p,{children:["Ein beliebtes Einstiegsthema ins Computerprogrammieren, sind die sogenannten ",_.jsx(e.strong,{children:"Turtle Graphics"}),". Da steuern Sie eine Schildkröte, die einen Stift bei sich trägt. Sie können der Schildkröte verschiedene Anweisungen geben, wie zum Beispiel 100 Einheiten nach vorne laufen, um 45° nach links drehen, dann 50 Einheiten zurück laufen, den Stift anheben und nochmals 50 Einheiten zurück laufen, usw. Alle diese Grafiken die man mit Turtles erstellen kann, können wir auch mit Pfaden erstellen. Besonders einfach geht das, wenn Sie die ",_.jsx(e.strong,{children:"relativen"})," Koordinaten verwenden. Damit wir alles schön übersichtlich haben, versuchen wir jeden neuen Befehl in einem Pfad, auf eine neue Zeile zu bringen, so wie wir das in dem unteren Beispiel gemacht haben. Sie können hier alles vor Zeile 15 ignorieren, das zeichnet uns nur ein Gitter, mit dem wir uns besser orientieren können."]}),`
