`,_.jsxs(e.p,{children:["Mit der ",_.jsx(e.code,{children:"CSS"}),"-Sprache, können wir das aussehen von einer Webseite anpassen. Hier sind praktische keine Grenzen gesetzt, man kann der Kreativität vollen lauf lassen, wenn man verstanden hat, wie ",_.jsx(e.code,{children:"CSS"})," funktioniert."]}),`
`,_.jsxs(e.p,{children:["Ganz Grundlegend gibt es in ",_.jsx(e.code,{children:"CSS"})," Regeln, die beschreiben wie ein Element dargestellt wird. So kann man zum Beispiel eine Regel erstellen, die besagt das alle Title eine grüne Schriftfarbe haben sollen. Diese Regeln gehen aber noch sehr viel weiter, man kann beinahe alles auf einer Webseite mit ",_.jsx(e.code,{children:"CSS"})," verändern."]}),`
